import React from "react";
import { Button } from "@mui/material";
import styles from "./Button.module.css";
function ButtonComponent({
	variant,
	buttonText,
	onClick,
	className,
type,
	fullWidth,
}) {
	return (
		<Button
			variant={variant}
			onClick={onClick}
			className={className}
			fullWidth={fullWidth}
			type={type}
		>
			{buttonText}
		</Button>
	);
}

export default ButtonComponent;
